* { margin: 0; padding: 0; box-sizing: border-box; }
body {
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
    background: linear-gradient(135deg, #e3f2fd 0%, #bbdefb 100%);
    padding: 20px;
    line-height: 1.6;
}
.container {
    max-width: 1400px;
    margin: 0 auto;
    background: white;
    border-radius: 20px;
    box-shadow: 0 20px 60px rgba(0,0,0,0.3);
    overflow: hidden;
}
.header {
    background: linear-gradient(135deg, #5c7cfa 0%, #748ffc 100%);
    color: white;
    padding: 40px;
    text-align: center;
}
.header h1 {
    font-size: 2.5em;
    margin-bottom: 10px;
    font-weight: 700;
}
.header p {
    font-size: 1.1em;
    opacity: 0.95;
}
.content {
    padding: 40px;
}
.overview-grid {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
    gap: 20px;
    margin-bottom: 40px;
}
.metric-card {
    background: linear-gradient(135deg, #4299e1 0%, #5a9fd4 100%);
    color: white;
    padding: 25px;
    border-radius: 15px;
    box-shadow: 0 10px 30px rgba(66, 153, 225, 0.3);
    transition: transform 0.3s ease;
}
.metric-card:hover {
    transform: translateY(-5px);
}
.metric-card .label {
    font-size: 0.9em;
    opacity: 0.9;
    margin-bottom: 5px;
}
.metric-card .value {
    font-size: 2.2em;
    font-weight: 700;
    margin-bottom: 5px;
}
.metric-card .description {
    font-size: 0.85em;
    opacity: 0.8;
}
.section {
    margin-bottom: 40px;
}
.section-title {
    font-size: 1.8em;
    color: #333;
    margin-bottom: 20px;
    padding-bottom: 10px;
    border-bottom: 3px solid #4299e1;
}
.card {
    background: #f8f9fa;
    border-radius: 12px;
    padding: 25px;
    margin-bottom: 20px;
    box-shadow: 0 4px 15px rgba(0,0,0,0.08);
}
.card-title {
    font-size: 1.3em;
    color: #4299e1;
    margin-bottom: 15px;
    font-weight: 600;
}
.info-grid {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
    gap: 15px;
}
.info-item {
    padding: 12px;
    background: white;
    border-radius: 8px;
    border-left: 4px solid #4299e1;
}
.info-item .label {
    font-size: 0.85em;
    color: #666;
    margin-bottom: 3px;
}
.info-item .value {
    font-size: 1.2em;
    font-weight: 600;
    color: #333;
}
.badge {
    display: inline-block;
    padding: 5px 12px;
    border-radius: 20px;
    font-size: 0.85em;
    font-weight: 600;
    text-transform: uppercase;
}
.badge-success { background: #28a745; color: white; }
.badge-warning { background: #ffc107; color: #333; }
.badge-danger { background: #dc3545; color: white; }
.progress {
    height: 30px;
    background: #e9ecef;
    border-radius: 15px;
    overflow: hidden;
    margin: 10px 0;
}
.progress-bar {
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    color: white;
    font-weight: 600;
    transition: width 0.6s ease;
}
.bg-success { background: #28a745; }
.bg-info { background: #17a2b8; }
.bg-warning { background: #ffc107; }
.bg-danger { background: #dc3545; }
.alert-box {
    padding: 15px 20px;
    border-radius: 8px;
    margin: 10px 0;
    border-left: 5px solid;
}
.alert-warning {
    background: #fff3cd;
    border-color: #ffc107;
    color: #856404;
}
.alert-danger {
    background: #f8d7da;
    border-color: #dc3545;
    color: #721c24;
}
.alert-info {
    background: #d1ecf1;
    border-color: #17a2b8;
    color: #0c5460;
}
table {
    width: 100%;
    border-collapse: collapse;
    margin: 15px 0;
}
th, td {
    padding: 12px;
    text-align: left;
    border-bottom: 1px solid #dee2e6;
}
th {
    background: #4299e1;
    color: white;
    font-weight: 600;
}
tr:hover {
    background: #f1f3f5;
}
.recommendations {
    background: #ffffff;
    color: #333;
    padding: 30px;
    border-radius: 12px;
    margin-top: 30px;
    box-shadow: 0 4px 15px rgba(0,0,0,0.08);
    border-left: 5px solid #4299e1;
}
.recommendations h3 {
    margin-bottom: 20px;
    color: #4299e1;
    font-size: 1.8em;
    font-weight: 700;
}
.recommendations h4 {
    color: #2d3748;
    font-weight: 600;
    font-size: 1.2em;
}
.recommendations ul {
    list-style: none;
    padding-left: 0;
}
.recommendations li {
    padding: 12px 0;
    padding-left: 35px;
    position: relative;
    border-bottom: 1px solid #e2e8f0;
    transition: background 0.2s ease;
}
.recommendations li:last-child {
    border-bottom: none;
}
.recommendations li:hover {
    background: #f7fafc;
    padding-left: 40px;
}
.recommendations li:before {
    content: 'â–¸';
    position: absolute;
    left: 10px;
    font-weight: bold;
    color: #4299e1;
    font-size: 1.2em;
}
.priority-badge {
    display: inline-block;
    padding: 3px 10px;
    border-radius: 12px;
    font-size: 0.75em;
    font-weight: 600;
    margin-left: 10px;
    text-transform: uppercase;
}
.priority-high { background: #feb2b2; color: #742a2a; }
.priority-medium { background: #fbd38d; color: #744210; }
.priority-strategic { background: #bee3f8; color: #2c5282; }
.footer {
    text-align: center;
    padding: 20px;
    color: #666;
    font-size: 0.9em;
    background: #f8f9fa;
}
